import { Spin } from 'antd'
import React from 'react'
import { LoadingOutlined } from '@ant-design/icons';

const Loader = () => {
  return (
    <div style={{position:"absolute",width:"100%",height:"100%",top:"50",left:"50",right:"0",bottom:"0"}}>
    <Spin
    indicator={
      <LoadingOutlined
        style={{
          fontSize: 48,
        }}
        spin
      />
    }
  /></div>
  )
}

export default Loader
